    disbursement on Schedule H for reimbursement for health insurance was to an employee
    who is NOT spending more than 25% of his time on Federal Election Activities.
    4. The disbursement of $ 14407 to Starboard was for direct mail that did not promote,
    support, attack or oppose any candidate for Federal office and did not meet the
    definition of Federal Election Activity under 11 CFR 100.24.  5. The disbursement
    to Starboard for $ 3663 was for our update, the disbursement for $ 62.06 was for
    invitations to the 2005 Victory Kick-off.  These communications did not promote,
    support, attack or oppose any candidate for Federal office and did not meet the
